/**
 * Created by ovesh on 25/8/20.
 */
import React from 'react';
import Form from "./Form";
import {Link} from "react-router-dom";


function ResetPass(){
    return (
        <div>
            <Form/>
            <div>
                <Link to="signup"> SignUp</Link>
                <hr/>
                <Link to="/"> SignUp</Link>
            </div>
        </div>
    );
}


export default ResetPass;
